import React from 'react';
import classes from './shoeMenu.module.css';

function ShoeMenu(props) {
    return(
        <div className={classes.menu}>
            <ul className={classes.categoryList}>
                <li className={classes.categoryItems}>Men
                    <div>
                        <div>
                            <ul>Casual Wear
                                <li>Sneakers</li>
                            </ul>
                        </div>
                    </div>
                </li>
                <li className={classes.categoryItems}>Women</li>
                <li className={classes.categoryItems}>Kids</li>
                <li className={classes.categoryItems}>Sports</li>
            </ul>
        </div>
    );
}

export default ShoeMenu;
